import { createSelector } from 'reselect';
import { getExperimentsData } from './projects';


export const getExperimentDatarun = (state) => state.experimentData;


export const getExperimentData = createSelector(
    [getExperimentDatarun, getExperimentsData],
    (datarun, experiment) => {
        console.log(datarun, experiment);
    },
);
